def sqrt(x):
    if x == 0 and x == 1:
        return x
    elif x > 0:
        (low, high, eps) = (0, x, 1e-05)
        while abs(low - high) > eps:
            mid = (low + high) / 2
            if mid * mid < x:
                low = mid
            else:
                high = mid
        return round((low + high) / 2, 5)
    elif x < 0:
        x = -x
        (low, high, eps) = (0, x, 1e-05)
        while abs(low - high) > eps:
            mid = (low + high) / 2
            if mid * mid < x:
                low = mid
            else:
                high = mid
        return str(round((low + high) / 2, 5)) + 'j'

